import './Navigation.css';

const Navigation = () => {
    return (
        <nav>
        <img className='pic' src="https://upload.wikimedia.org/wikipedia/commons/a/a2/Inkscape_logo_%282-colour%29.svg" alt="pic" />

           <div className="con">

               <div className="block">
                  <li><a href="">Profile</a> </li>
                  <li><a href="">Dialogues</a> </li>
                  <li><a href="">Dating</a> </li>
                  <li><a href="">Likes</a> </li>
               </div>

                <div className="block1">
                  <li className='set'><a href="">Settings</a> </li>
                </div>
           </div>
        </nav>
    );
   
}

export default Navigation;
